import { BaseNode } from "./BaseNode";

export const LLMNode = ({ id, data }) => {
  return (
    <BaseNode
      id={id}
      title="LLM"
      data={data}
      leftHandles={[
        { id: `${id}-system`, style: { top: "33%" } },
        { id: `${id}-prompt`, style: { top: "66%" } },
      ]}
      rightHandles={[{ id: `${id}-response`, style: {} }]}
      slotTop={
        <div>
          <span>This is a LLM.</span>
        </div>
      }
    />
  );
};
